<script>

    function reportApplication() {
        const { html, render, useState, useEffect } = window.preactStandalone;

        function ReportSummary({reportSummary, onSummaryClick}) {
            return html`
                <ul>
                    ${reportSummary.map(item => html`
                        <li><a href="#" onClick=${() => onSummaryClick(item.type)}>
                            ${item.type} (${item.count})
                            </a>
                        </li>
                    `)}
                </ul>
            `;
        }

        function App({reportData}) {
            const [reportSummary, setReportSummary] = useState([{type: 'test', count: 1}]);
            const [showTypeData, setShowTypeData] = useState(null);
            const [activeTab, setActiveTab] = useState('');
            const [activeDetails, setActiveDetails] = useState('');

            useEffect(() => {
                if (reportData) {
                    // setReportSummary([{type: 'test', count: 1}]);
                    let counts = {};
                    for(let item of reportData) {
                        counts[item.type] = counts[item.type] ? counts[item.type] + 1 : 1;
                    }
                    setReportSummary(Object.keys(counts).map(type => ({type, count: counts[type]})));
                }
            }, []);

            function handleSummaryClick(type) {
                setShowTypeData(type);
                setActiveTab('list');
            }

            function handleListClick(item) {
                setActiveTab('details');
                setActiveDetails(item);
            }

            function detailSummary(item) {
                if (!item) {
                    return '';
                }
                if (item.type == 'ERROR') {
                    return html`<div className="error"> This accession was marked as having an error so won't be loaded.</div>`;
                } else if (item.type == 'LOAD') {
                    return html`<div className="success"> This accession will be loaded.</div>`;
                }
            }

            if (!reportData || !reportSummary) {
                return html`
                    <div>
                        <h4>No Report Data Provided</h4>
                    </div>
                `;
            }

            return html`
                <div id="report">
                    <h1>UniProt Load Report</h1>
                    <h2 style=${{ textAlign: 'center' }}>  </h2>
                    <div id='content'>
                        <div id="left-nav">
                            <h2>Summary</h2>
                            <p>These are the types of actions that will be performed by the load.</p>
                            <${ReportSummary} reportSummary=${reportSummary} onSummaryClick=${handleSummaryClick}/>
                        </div>
                        <div id="right-content">
                            ${activeTab == 'list' && html`
                            <div>
                                <h2>List of Load Actions by Accession</h2>
                                <p>This is the list of actions that will be performed for each accession that was encountered.</p>
                                <ul>
                                    ${reportData.map(i => {
                                        if (showTypeData && i.type !== showTypeData) {
                                            return null;
                                        }
                                        return html` <li><a href="#" onClick="${() => handleListClick(i)}">${i.accession} : ${i.title}</a></li> `;
                                    })}
                                </ul>
                            </div>
                            `}
                            ${activeTab == 'details' && html`
                            <div>
                                <h2>Details for Accession</h2>
                                <h3>${activeDetails.accession}</h3>
                                <p>${detailSummary(activeDetails)}</p>
                                <h3>${activeDetails.title}</h3>
                                <pre>${activeDetails.details}</pre>
                                <h4>Links</h4>
                                <ul>
                                    ${activeDetails.links.map(link => html`<li><a target="_blank" href="${link.href}">${link.title}</a></li>`)}
                                </ul>
                            </div>
                            `}
                        </div>
                    </div>
                </div>
            `;
        }
        render(html`<${App} reportData=${window.UNIPROT_REPORT}/>`, document.getElementById('root'));
    }

    document.addEventListener('DOMContentLoaded', () => {
        reportApplication();
    });
</script>

<div id="root"></div>

</body>

</html>
